INSERT INTO `hotel` (`id`, `name`, `address`, `status`, `description`, `pic_url`) VALUES
(20, 'Shibuya Excel Hotel Tokyu Tokyo', '10-30 Takanawa 4-chome, Minato-ku ,Shinagawa,Tokyo,Japan', 1, 'Shinagawa is the south entrance to Tokyo. The Shinagawa Prince Hotel, which is in front of Shinagawa Station, has good access to Narita Airport, Haneda Airport, Big Site, and the Tokyo Forum, as well as movie theaters, bowling, the Epson Shinagawa Aqua Stadium, tennis, golf, swimming pools and other entertainment facilities. From business to sightseeing, this is an entertainment hotel that guests can enjoy in many ways.', '/img/hotel/hotel2.jpeg'),
(126, 'The Peninsula Tokyo', '2-2-1 Nishi-Shinjuku, Shinjuku-ku ,Shinjuku/Nakano,Tokyo,Japan', 1, 'In Shinjuku’s Skyscraper District just a 5-minute walk from Shinjuku Train Station, Keio Plaza Hotel Tokyo offers sweeping views of Shinjuku, free Wi-Fi and 21 dining options.The Tokyo Metropolitan Government Building is less than a 5-minute walk away, and the Kabukicho area is a 15-minute walk from the property. Meiji Jingu Shrine and Shinjuku Gyoen National Garden are both about a 20-minute walk away.The comfortable rooms at Tokyo Hotel Keio Plaza include a flat-screen TV with satellite and pay-per-view channels. Panoramic views of the Shinjuku skyline can be enjoyed from the rooms. Japanese-style Yukata robes and slippers are provided for all guests.Guests can work up a sweat in the fitness center or, for a fee, take a cool swim in the outdoor pool. The hotel also features a karaoke room, convenience store and business center. A free shuttle to Tokyo Disney Resort is provided.Amanogawa Sake Bar pours premium sake. The wide range of cuisines are served at Keio Plaza Hotel includes Japanese, French, Italian, Chinese and Korean.', '/img/hotel/hotel3.jpeg'),
(127, 'Wynn Palace', 'Avenida Da Nave Desportiva,Cotai?Macau ,Taipa,Macau,China', 1, 'Wynn Palace resets the world’s expectations for luxury. With an entrance that boasts an 8-acre lake, 25-story dancing fountains, Golden Dragons, and glass cable cars around the water’s edge, the ride over this stunning scene transports you to another world. ', '/img/hotel/hotel4.jpeg'),
(128, 'Studio City Hotel', 'Estrada do Istmo, Cotai Macau ,Cotai,Macau,853,China', 1, 'he Studio City Hotel (Hongguan Xinying Jiudian) is located just 3 km (2 mi) from Macao International Airport. The Museum of Taipa and Coloane and Macau Tower Convention & Entertainment Centre are all within a short distance. Guests can dine on Chinese, international and Asian cuisines at the on-site restaurants. In their spare time, guests can unwind with a a relaxing “picnic by the pool” and enjoy a variety of drinks at the Cabana Bar and Premier Bar. Quick bites including ', '/img/hotel/hotel5.jpeg'),
(129, 'Keio Plaza Hotel Tokyo', '2-2-1 Nishi-Shinjuku, Shinjuku-ku ,Shinjuku/Nakano,Tokyo,Japan', 1, 'In Shinjuku’s Skyscraper District just a 5-minute walk from Shinjuku Train Station, Keio Plaza Hotel Tokyo offers sweeping views of Shinjuku, free Wi-Fi and 21 dining options.The Tokyo Metropolitan Government Building is less than a 5-minute walk away, and the Kabukicho area is a 15-minute walk from the property. Meiji Jingu Shrine and Shinjuku Gyoen National Garden are both about a 20-minute walk away.The comfortable rooms at Tokyo Hotel Keio Plaza include a flat-screen TV with satellite and pay-per-view channels. Panoramic views of the Shinjuku skyline can be enjoyed from the rooms. Japanese-style Yukata robes and slippers are provided for all guests.Guests can work up a sweat in the fitness center or, for a fee, take a cool swim in the outdoor pool. The hotel also features a karaoke room, convenience store and business center. A free shuttle to Tokyo Disney Resort is provided.Amanogawa Sake Bar pours premium sake. The wide range of cuisines are served at Keio Plaza Hotel includes Japanese, French, Italian, Chinese and Korean.', '/img/hotel/hotel6.jpeg'),
(130, 'Yasuragi Ioujima Hotel', '1-3277-7 Iojimamachi ,Nagasaki,Japan', 1, 'Stop at Yasuragi Ioujima Hotel to discover the wonders of Nagasaki. The hotel offers a high standard of service and amenities to suit the individual needs of all travelers. All the necessary facilities, including free Wi-Fi in all rooms, daily housekeeping, laundromat, 24-hour front desk, facilities for disabled guests, are at hand. Guestrooms are fitted with all the amenities you need for a good night''s sleep. In some of the rooms, guests can find television LCD/plasma screen, air conditioning, heating, wake-up service, balcony/terrace. The hotel offers various recreational opportunities. Convenience and comfort makes Yasuragi Ioujima Hotel the perfect choice for your stay in Nagasaki.', '/img/hotel/hotel1.jpeg'),
