(178, 'Yasuragi Ioujima Hotel', '1-3277-7 Iojimamachi ,Nagasaki,Japan', 1, 'Stop at Yasuragi Ioujima Hotel to discover the wonders of Nagasaki. The hotel offers a high standard of service and amenities to suit the individual needs of all travelers. All the necessary facilities, including free Wi-Fi in all rooms, daily housekeeping, laundromat, 24-hour front desk, facilities for disabled guests, are at hand. Guestrooms are fitted with all the amenities you need for a good night''s sleep. In some of the rooms, guests can find television LCD/plasma screen, air conditioning, heating, wake-up service, balcony/terrace. The hotel offers various recreational opportunities. Convenience and comfort makes Yasuragi Ioujima Hotel the perfect choice for your stay in Nagasaki.', '/img/hotel/hotel1.jpeg'),
(179, 'Shibuya Excel Hotel Tokyu Tokyo', '10-30 Takanawa 4-chome, Minato-ku ,Shinagawa,Tokyo,Japan', 1, 'Shinagawa is the south entrance to Tokyo. The Shinagawa Prince Hotel, which is in front of Shinagawa Station, has good access to Narita Airport, Haneda Airport, Big Site, and the Tokyo Forum, as well as movie theaters, bowling, the Epson Shinagawa Aqua Stadium, tennis, golf, swimming pools and other entertainment facilities. From business to sightseeing, this is an entertainment hotel that guests can enjoy in many ways.', '/img/hotel/hotel2.jpeg'),
